"use strict";

var _utils = require("./../utils");

describe('libs utils', function () {
  describe('uniqueId', function () {
    it('should return the unique id', function () {
      expect((0, _utils.uniqueId)()).toBe('1');
    });
    it('should return the unique id with the prefix passed', function () {
      expect((0, _utils.uniqueId)('input')).toBe('input-2');
    });
  });
});